import React from 'react'
import { useSelector } from 'react-redux'

function Home() {

  const { user } = useSelector(state => state.auth)
  const { allPosts } = useSelector(state => state.allPosts)

  if (user) {

    return (
      <div>
        {allPosts.length}
      </div>
    )

  } else {

    return (
      <></>
    )
    
  }
}

export default Home
